import React from "react";

class SubmitButton extends React.Component {
    render() {
        return (
            <div className="submitButton">
                <button
                    className="btn"
                    disabled={this.disabled}
                    onClick={ () => this.props.onClick()}
                >

                </button>
            </div>
        );
    }
}

export default SubmitButton;
